import React from "react"
class PropsANDState extends React.Component{
    constructor(props){
        super(props)
        this.obj={
            name:'Wasim',
            age : 23,
            exp : '3 Years'
        }
    }
    render(){
        return (
            <div>
            <NewProps npProps ={this.obj.name} age={this.obj.age} exp={this.obj.exp}/>

            </div>
        )
    }

} 
class NewProps extends React.render{
    render(){
        return (
            <div>
                <h1>Example of Props and State</h1>
                <h3>{this.props.npProps}</h3>
            </div>
        )
    }
}
export default PropsANDState
